import React, { useState, useEffect } from "react";

function TodoApp() {
  const [todos, setTodos] = useState([]);

  // Fetch todos from backend
  useEffect(() => {
    fetch("http://localhost:5000/todos")
      .then(res => res.json())
      .then(data => setTodos(data));
  }, []);

  return (
    <div>
      <h1>My Todos</h1>
      <ul>
        {todos.map(todo => (
          <li key={todo._id}>
            {todo.text} - {todo.completed ? "✅" : "❌"}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default TodoApp;
